import React, { Component } from "react";

const Star = (props) => (
  <svg viewBox="0 0 512 512" width="20" height="20" {...props}>
    <path
      fill="currentColor"
      d="M256 13l79 160 177 26-128 124 30 176-158-83-158 83 30-176L0 199l177-26 79-160z"
    />
  </svg>
);

class Amenu extends Component {
  render() {
    return (
      <div className="col-3 amenu ">
        <p className="text-center meteo-text my-5">METEOROLOG</p>
      </div>
    );
  }
}

export default Amenu;
